window.bookSummaryJSON = "<p>RULE #3 OF WALL STREET: NEVER BACK DOWN</p> <p>No one can know I've claimed the human as my mate.</p> <p>The enemies are at the gates–one wrong move and I’ll lose it all. My world will never be safe for her.</p> <p>If my pack finds out that I’ve mated a human, they’ll revolt. The fractures will grow deeper than ever and we'll be picked apart one by one.</p> <p>The lives of everyone I love hang in the balance.</p> <p>Madison may bear my mark, but she isn’t content to remain my dirty little secret.</p> <p>Now I must choose–love or my pack.</p> <p><i>Either way, one will die.</i></p> <p><i>Marked is book three in the Big Bad Boss trilogy. The books must be listened to in order. It features a billionaire boss-hole wolf shifter and his freakishly smart assistant.</i></p>"; 
